import React from 'react';
import { Link } from 'react-router-dom';
import { Header } from './Header';
import net from "./network.jpg";

export default class Home extends React.Component {
	render() {
		return (
			<>
			<center>
				<div style={{"margin" : "2em"}}>
					<img 
						alt="logo" 
						src={net}
						style={{"height" : "200px"}}/>
					<h2>
						The Slaton Network Workbook
					</h2>
					<p>GreenerLife™'s mission in this world 
						is to help people to decrease the 
						amount of waste they create in 
						their lives by allowing them to 
						see what their habits are and how 
						to change them. The environment is 
						currently in its downfall, partially
						caused by the amount of trash made 
						throughout the world on a daily 
						basis. But how is one person 
						supposed to make a difference? The 
						team here at GreenerLife™ set out 
						to fix this problem, and here we are!</p>
				</div>
			</center>
			</>
		);
	}
}
